data.value:
ПОЛИМОРФИЗМ

Динамическое связывание, или позднее связывание, или связывание во время выполнения. Предоставляет еще одну степень отделения интерфейса от реализации (что от как). Разделяет логически в контексте типов. Вызов полиморфного метода позволяет одному типу выразить свое отличие от другого (сходного), хотя они и происходят от одного базового типа.

Note.java
package polymorphism.music;
public enum Note {
 MIDDLE_C, C_SHARP, B_FLAT;
}
Instrument.java
package polymorphism.music;
public class Instrument {
 public void play(Note n) {
 System.out.println("Instrument.play()");
 }
}
Wind.java
package polymorphism.music;
public class Wind extends Instrument {

 @Override
 public void play(Note n) {
 System.out.println("Wind.play() " + n);
 }
}
Music.java
package polymorphism.music;
public class Music {
 public static void tune(Instrument i) {
 i.play(Note.MIDDLE_C);
 }
 public static void main(String[] args) {
 Wind flute = new Wind();
 tune(flute);
 }
}
Wind.play() MIDDLE_C

Присоединение вызова метода к телу метода называется связыванием. Если связывание проводится перед запуском программы, оно называется ранним связыванием (early binding). Раннее связывание в классе Music неоднозначно. Компилятор не может знать, какой метод нужно вызывать, когда у него есть только ссылка на объект Instrument. Проблема неоднозначности решается благодаря позднему связыванию (late binding), то есть связыванию, проводимому во время выполнения программы, в зависимости от типа объекта. late binding = dynamic binding = runtime binding Для всех методов Java используется механизм позднего связывания, если только метод не был объявлен как final (private или static).

Классический пример полиморфизма в ООП:

Shape s = new Circle() // upcasting
// ...
s.draw() // late binding
Shape.java
package polymorphism.shape;
public class Shape {
 public void draw() {}
 public void erase() {}
}
