«Переопределение» закрытых методов

package polymorhism;
public class PrivateOverride {
 private void f() {
 System.out.println("private f()");
 }
 public static void main(String[] args) {
 PrivateOverride po = new Derived();
 po.f();
 }
}
class Derived extends PrivateOverride {
 public void f() {
 System.out.println("public f()");
 }
}
private f()

Статические методы также не поддерживают полиморфного поведения.

package polymorhism;
class StaticSuper {
 public static String staticGet() {
 return "Базовая версия staticGet()";
 }
 public String dynamicGet() {
 return "Базовая версия dynamicGet()";
 }
}
class StaticSub extends StaticSuper {
 public static String staticGet() {
 return "Производная версия staticGet()";
 }
 public String dynamicGet() {
 return "Производная версия dynamicGet()";
 }
}
public class StaticPolymorphism {
 public static void main(String[] args) {
 StaticSuper sup = new StaticSub();
 System.out.println(sup.staticGet());
 System.out.println(sup.dynamicGet());
 }
}
Базовая версия staticGet()
Производная версия dynamicGet()

Порядок вызова конструкторов (композиция + наследование)
package polymorhism;
class Meal {
 Meal() {
 System.out.println("Meal()");
 }
}
class Bread {
 Bread() {
 System.out.println("Bread()");
 }
}
class Cheese {
 Cheese() {
 System.out.println("Cheese()");
}
}
class Lettuce {
 Lettuce() {
 System.out.println("Lettuce()");
 }
}
class Lunch extends Meal {
 Lunch() {
 System.out.println("Lunch()");
 }
}
class PortableLunch extends Lunch {
 PortableLunch() {
 System.out.println("PortableLunch()");
 }
}
public class Sandwich extends PortableLunch {
 private Bread b = new Bread();
 private Cheese c = new Cheese();
 private Lettuce l = new Lettuce();
 Sandwich() {
 System.out.println("Sandwich()");
 }
 public static void main(String[] args) {
 new Sandwich();
 }
}
Meal()
Lunch()
PortableLunch()
Bread()
Cheese()
Lettuce()
Sandwich()

Конструкторы для сложного объекта вызываются в следующей последовательности:
     • Сначала вызывается конструктор базового класса. Этот шаг повторяется рекурсивно от «корня иерархии» до самого «младшего» производного класса;
     • Проводится инициализация членов класса в порядке их объявления;
     • Вызывается тело конструктора производного класса.
При вызове динамически связываемого метода в конструкторе используется переопределенное описание этого метода. Динамически связываемый вызов может перейти к производным классам (во внешнюю часть иерархии). Вызов метода производного класса в конструкторе может привести к манипуляциям с неинициализированными данными.
package polymorhism;
class Glyph {
 void draw() {
 System.out.println("Glyph.draw()");
 }
 Glyph() {
 System.out.println("Glyph() перед вызовом draw()");
 draw();
 System.out.println("Glyph() после вызова draw()");
 }
}
class RoundGlyph extends Glyph {
 private int radius = 1;
 RoundGlyph(int r) {
 radius = r;
 System.out.println("RoundGlyph.RoundGlyph(), radius = «
 + radius);
 }
 void draw() {
System.out.println("RoundGlyph.draw(), radius =
" + radius);
 }
}
public class PolyConstructors {
 public static void main(String[] args) {
 new RoundGlyph(5);
 }
}
Glyph() перед вызовом draw()
RoundGlyph.draw(), radius = 0
Glyph() после вызова draw()
RoundGlyph.RoundGlyph(), radius = 5

Вызов конструкторов (+ полиморфизм):
    • Память, выделенная под новый объект заполняется двоичными нулями;
    • Вызываются конструкторы базовых классов. ! Вызывается переопределенный метод draw() (перед вызовом конструктора класса RoundGlyph). Переменная radius равна нулю !;
    • Вызываются инициализаторы членов класса в порядке их определения;
    • Вызывается тело конструктора производного класса.

Ковариантность возвращаемых типов

Переопределенный метод производного класса может вернуть тип, производный от типа, возвращаемого методом базового класса.
package polymorhism;
class Grain {
 public String toString() {
 return "Grain";
 }
}
class Wheat extends Grain {
 public String toString() {
 return "Wheat";
 }
}
class Mill {
 Grain process() {
 return new Grain();
 }
}
class WheatMill extends Mill {
 Wheat process() {
 return new Wheat();
 }
}
public class CovariantReturn {
 public static void main(String[] args) {
 Mill m = new Mill();
 Grain g = m.process();
 System.out.println(g);
 m = new WheatMill();
 g = m.process();
 System.out.println(g);
 }
}
